import { Suspense } from 'react';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Suspense fallback={<div>Loading...</div>}>

          <Routes>
            <Route path='/' element={<Layout />} />

            <Route path="/login" element={<Login />}>
            </Route>
          </Routes>
        </Suspense>
      </BrowserRouter>

    </div>
  );
}

export default App;
